import "./arrivals.css";

const Arrivals = () => {
  return (
    <section className="arrivals">
      <div className="container">
        <div className="arrivals__header">
          <h2>NEW ARRIVALS</h2>
        </div>
        <div className="arrivals__cars"></div>
      </div>
    </section>
  );
};

export default Arrivals;
